import React from "react";
import '../assets/css/FourItem.css';
import ItemPro4 from './ItemPro4';
import PayCenter from '../components/PayCenter';
import ItemDivide from '../components/ItemDivide';
class FourItem extends React.Component {
  // componentDidMount() {
  //   document.title = '开发中';
  //  }

  render() {
    const { itemData } = this.props;
    const dataProps=[];
    if(itemData&&itemData['goods_list']){
      let listData=itemData['goods_list'];
      for (let index = 0; index < listData.length; index++) {
        const imgUrl = listData[index]['image'];
        const oldPrice = listData[index]['price'];
        const title = listData[index]['title'];
        const url = listData[index]['url'];
        dataProps[index]={imgUrl,oldPrice,url,title};
      }
    }
    const totalPrice=itemData&&itemData['official_receipts']?itemData['official_receipts']:0.00;
    return (
      <div className="FourItemMain">
        <div className="FourItemBox">
          <div className="FourItemOne"><ItemPro4 isMain={this.props.fixMain?true:false} {...dataProps[0]}/></div>
          <div className="FourItemOne"><ItemPro4 {...dataProps[1]}/></div>
          <div className="FourItemOne"><ItemPro4 {...dataProps[2]}/></div>
          <div className="FourItemOne"><ItemPro4 {...dataProps[3]}/></div>
        </div>
        <PayCenter price={totalPrice}/>
        <ItemDivide/>
      </div>
    );
  }
}

export default FourItem;
